import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);


export const origin = root.render(
                                <React.StrictMode>
                                  <App />
                                </React.StrictMode>
                              );

export default root.render
